import { Suspense } from "react";
import App from "./App";

const GetApp = () => {
  setTimeout(() => {
    var promise = new Promise((resolve, reject) => {
      let name = "Paul";

      if (name === "Paul") {
        resolve("Promise resolved successfully");
      } else {
        reject(Error("Promise rejected"));
      }
    });
    return promise;
  }, 3000);
};
const Test = async () => {
  const a = GetApp();
  return <App a={a} />;
};
const Major = () => {
  return (
    <Suspense fallback={<h1>Loading</h1>}>
      <App />
    </Suspense>
  );
};

export default Major;
